import React from "react";
import "./specials.css";

interface Props {
  isMobile: boolean;
}

export default function Specials(props: Props) {
  return (
    <div>
      <div>
        <h1>Looking for the specials?</h1>
        <div className="specials-header">
          <div className={props.isMobile ? "col-12" : "col-4"}>
            <img
              className="specials-img"
              src="https://wellcall-app-cdk.s3.amazonaws.com/Christmas+Cookie+Sale+Advertisment+Picture.jpg"
            />
          </div>
        </div>
        <a href="/order-inquiry">
          <button>Order Now</button>
        </a>
      </div>
    </div>
  );
}
